import PropTypes from "prop-types"
import TodosContainer from "./TodosContainer"
import AllTodos from "./AllTodos";

class Main extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className="container">
          <div className="header">
            <h1>Todo List</h1>
          </div>
          <TodosContainer />
        </div>
      </React.Fragment>
    );
  }
}

export default Main
